import React from "react";
import './MainPage.css';
import './components/Navbar';

const MainPage=()=>{
    return(
        <div className="main-container">
            <div className="studentInfo">
                <div className="">
                <h1>Student Information</h1>
                <p>Student Name: </p>
                <p>Student ID:</p>
                </div>
            </div>
        </div>
    )
}

export default MainPage;
